import React from 'react';
import { PageContainer, PageTitleOne, PageTitleTwo, PageText, PageAnchorTag } from '../global-page-styles/global-page-styles';
import { CustomButton } from '../../components/custom-button/custom-button.component';

import { AboutDescription } from './about.styles';


const AboutPage = (props) =>{

  return (
    <PageContainer>
    <PageTitleOne className='date'>About</PageTitleOne>
    <PageTitleTwo>Description and Mission Statement:</PageTitleTwo>
    <PageText>Dale Street is a Mixing, Mastering, & Production Studio. Whether getting a track or album ready for release to a myriad of different formats and streaming playback; or working on a new production, I'd love to see how I can help.</PageText>

    <PageTitleTwo>About:</PageTitleTwo>
    <PageText>As a longtime DJ and musician, Marcus Dale Norwood, aka DJ Definition (hiphop) and M.D. Norwood (garage rock & soul), started Dale Street Studio to represent his expanding studio and 20+ years of experience in audio.
    </PageText>
    <PageTitleTwo>Booking:</PageTitleTwo>
    <PageText style={{marginBottom: '45px', textAlign: 'center'}}>Let me know how you'd like me to help on your project. Contact me today to get rates and book my services.
    </PageText>
    <CustomButton onClick={() => props.history.push('/')}>Home</CustomButton>  
    </PageContainer>
  )
};




export default React.memo(AboutPage);
